const CACHE_NAME="weather-cache-v1",urlsToCache=["/","/css/style.min.css","/js/script.min.js","/img/logo.webp"];self.addEventListener("install",(e=>{e.waitUntil(caches.open(CACHE_NAME).then((e=>e.addAll(urlsToCache))))})),self.addEventListener("fetch",(e=>{e.respondWith(caches.match(e.request).then((s=>s||fetch(e.request))))}));